import React from "react";

export default function ResultBar(props) {
  return (
    <div
      style={{
        height: "30px",
        width: "100%",
        position: "absolute",
        bottom: "10px",
        border: "1px solid black",
        borderRadius: "5px",
      }}
    >
      <div
        style={{
          height: "30px",
          width: props.width,
          borderRadius: "5px",
          backgroundColor: "#A9AAA9"
        }}
      ></div>
    </div>
  );
}
